import React from 'react';
import logo from './logo.svg';
import './App.css';
import { Stack, Button } from '@mui/material';

function App() {
  return (
    <div className="App">
      <Stack direction="row" spacing={2}>
        <Button variant="contained">Contained</Button>
      </Stack>
    </div>
  );
}

export default App;
